import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';

/*function addNewlines(str) {
    var result = '';
    while (str.length > 0) {
      result += str.substring(0, 200) + '\n';
      str = str.substring(200);
    }
    return result;
  }*/

  
  var map = new Map();
  map.set("Contributor 1", "I am a cat");
  map.set("Contributor 2", "I am a dog");
  map.set("Contributor 3", "I am a cow");

function Contributors() {

    

    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
            {(printContributors(map))}
        </div>
       
    );
}

  
  window.onload=function(){
      window.printContributors=function(){
    <p id="demo"></p>
    for (let key of  map.keys()) {
        <div className = "Contributor-Name">
        <script>
        {document.getElementById("demo").innerHTML += key +"\n"};
        </script>
        </div>
    }
    }
   
  }

export default Contributors;

